A little girl who always dreamt of being on the ramp to a young woman taking the stage with pride and confidence, being a part of the pageantry world has shaped me into what I am today, it has taught me self confidence, resilience and perseverance. Im filled with gratitude to be able to represent my state 🤍#meghalaya 

Feeling incredibly grateful and honored to be selected as a finalist for Livon Mega Miss North East 21st Edition! A Legacy Since 2003. This journey is a dream come true, and I can’t wait to represent the spirit, strength, and beauty of my state. Need all your love and support. This is just the beginning! 

